import CoinLogo from './CoinLogo';
import Menu from './Menu'

function StartHeader() {
    return (
        <div className='StartHeader'>
            <CoinLogo width="60" height="60"/>
            <span id="flip">FLIP</span>
            <Menu width="50" height="50" />
        </div>  
    );
};

export default StartHeader;
